import React from 'react';
import MyDate from './MyDate';

const LogItem = () => {
    return (
        <div>
          <MyDate/>
            <div className="content">
                <h2 className="desc">学习React</h2>
                <div className="time">40</div>
            </div>
        </div>
    );
};

export default LogItem;
